  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:56.353171\",\n\t\"name\": \"deer-carry-capacity-on-the-rocky-mountain-arsenal-national-wildlife-refuge-based-on-dry-ma\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In a landscape dominated by urban development,
  the Rocky Mountain Arse:oal (RMA) is an especially important refuge for mule and
  white-tailed deer. RMA biologists estimate the current deer population exceeds 900
  animals (approximately 250-300 white-tailed deer and 650-700 mule deer). The Comprehensive
  Management Plan for the RMA, completed in 1996, states that the Fish and Wildlife
  Service (Service) will manage deer populations between 325 and 550 total deer. These
  goals were generally based on habitat conditions from the early 1990' s and deer
  research conducted on the refuge in the late 1980's (Matiatos pers. comm. 1999).
  A specific study evaluating carrying capacity of the habitats on the RMA had never
  been conducted. The current management approach is a conservative one that attempts
  to suppress deer populations and minimize habitat degradation by culling females.
  Culling may have suppressed populations somewhat, but the estimated total population
  is much higher than the current management goal. The large numerical span between
  the population estimate and the management goal indicates that habitats on the RMA
  may be able to support a much higher population of deer than was originally thought.
  Recognizing this need to evaluate the available habitats and create a more scientifically
  based method to estimate carrying capacity, the Service initiated this study.\",\n\t\"license_title\":
